/**
 * Trova il quartiere in base alle coordinate GPS
 * @param {{latitude: number, longitude: number}} coords - Coordinate dell'utente
 * @returns {{district: string, calendarType: string}} | null - Informazioni del quartiere o null
 */
function findDistrictByCoordinates(coords) {
    const point = [coords.longitude, coords.latitude];
    
    for (let feature of DISTRICTS_DATA.features) {
        if (isPointInPolygon(point, feature.geometry)) {
            const properties = feature.properties;
            
            // Ottieni il nome del quartiere dai dati OpenData
            let openDataName = properties.OMOGENEA || properties.nome_zona || properties.district_name;
            
            if (openDataName) {
                // Normalizza il nome (minuscolo, rimuovi caratteri speciali)
                const normalizedName = openDataName.toLowerCase()
                    .replace(/`/g, '')
                    .replace(/\s+/g, ' ')
                    .trim();
                
                // Cerca nella mappatura OpenData -> Quartiere DISTRICTS
                const districtName = OPENDATA_TO_DISTRICT_MAP[normalizedName];
                
                if (districtName) {
                    // Trova il tipo di calendario per questo quartiere usando CALENDAR_MAP
                    const calendarType = CALENDAR_MAP[districtName.toLowerCase().trim()];
                    
                    return {
                        district: districtName,
                        calendarType: calendarType || "azzurro"
                    };
                }
            }
            
            // Se non trova una mappatura, ritorna i dati raw
            return {
                district: openDataName || "Sconosciuto", 
                calendarType: "azzurro"
            };
        }
    }
    
    return null;
}

/**
 * Verifica se un punto è all'interno di un poligono (Ray Casting Algorithm)
 * @param {{number[]}} point - [longitude, latitude]
 * @param {{Object}} polygon - Geometria del poligono GeoJSON
 * @returns {{boolean}} - true se il punto è dentro il poligono
 */
function isPointInPolygon(point, polygon) {
    if (polygon.type === 'Polygon') {
        return isPointInPolygonRing(point, polygon.coordinates[0]);
    } else if (polygon.type === 'MultiPolygon') {
        for (let poly of polygon.coordinates) {
            if (isPointInPolygonRing(point, poly[0])) {
                return true;
            }
        }
    }
    return false;
}

/**
 * Ray casting algorithm per verificare se un punto è in un anello di poligono
 * @param {{number[]}} point - [longitude, latitude]  
 * @param {{number[][]}} ring - Array di coordinate dell'anello
 * @returns {{boolean}}
 */
function isPointInPolygonRing(point, ring) {
    const x = point[0];
    const y = point[1];
    let inside = false;
    
    for (let i = 0, j = ring.length - 1; i < ring.length; j = i++) {
        const xi = ring[i][0];
        const yi = ring[i][1];
        const xj = ring[j][0]; 
        const yj = ring[j][1];
        
        if (((yi > y) !== (yj > y)) && (x < (xj - xi) * (y - yi) / (yj - yi) + xi)) {
            inside = !inside;
        }
    }
    
    return inside;
}

// Esporta le funzioni per l'uso nell'app
if (typeof module !== 'undefined' && module.exports) {
    module.exports = {
        DISTRICTS_DATA,
        CALENDAR_MAP,
        findDistrictByCoordinates,
        isPointInPolygon
    };
}
